import React from "react";

const VinoList = ({ vinos, onDeleteVino, onSelectVino, onEditVino }) => {
  if (!vinos || vinos.length === 0) {
    return <p>No hay vinos disponibles.</p>;
  }

  return (
    <div>
      <h2>Lista de Vinos</h2>
      <ul>
        {vinos.map((vino) => (
          <li key={vino._id}>
            {vino.nombre} - {vino.tipo}
            <button onClick={() => onSelectVino(vino._id)}>Ver detalles</button>
            <button onClick={() => onEditVino(vino._id)}>Editar</button>
            <button onClick={() => onDeleteVino(vino._id)}>Eliminar</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default VinoList;
